NO CONTEST plea entered to count 1, bail jumping.  Convicted.
The State moves to dismiss and read in count 2, retail theft.  Motion granted.
Sentence withheld and the defendant placed on probation to DOC for three (3) years.
Conditions of probation:
1) spend six (6) months county jail, under the Huber Law, commencing on 06-09-15 by 8:00 a.m.;
2) assessment, treatment, counseling as deemed appropriate by the Department's assessment process;
3) Sexual offender evaluation and follow through counseling;
4) defendant will be subject to the Department's computer rules for people convicted of crimes involving a sexual component;
5) no internet access except as required by employer;
6) any mobile device shall not include internet access nor any social media or email accounts and be under the supervision of the corrections agent;
7) maintain fulltime employment and/or school;
8) pay court costs;
9) pay supervision fees in an amount to be determined by DOC.
10) defendant is to have no unsupervised contact with minor children other than his own;
11) defendant is ordered to turn over to his agent any existing social medial and email accounts.
Minutes.
